import React, { useEffect, useState } from 'react'
import Sidebar from './Sidebar'


function Movies() {
  const [page,setPage] = useState(1);
  const [content, setContent] = useState([]); 
  const fetchMovies = async () =>{
    const {data} = await axios.get("https://api.themoviedb.org/3/discover/movie?api_key=d2be8d71bbce316ce6cf341ced96a652&language=en-US&sort_by=popularity.desc&include_adult=false&include_video=false&page=1&with_watch_monetization_types=flatrate")
  };

  useEffect(() => {
    fetchMovies();
  }, []);

  return (
    <>
     <div>
          <span className='pagetitle'>Movies</span>
      </div>
    <Sidebar />
    </>
  )
}

export default Movies
